description:
- Mặt tiền rộng, thửa đất nằm trên mặt đường Lê Đức Thọ, mặt sau là ngõ. Rất thuận tiện cho việc kinh doanh, buôn bán.
* Đặc điểm:
- Nằm trong khu vực kinh doanh sầm uất nhất Quận Nam Từ Liêm;
- Ngay cạnh Sân Vận Động Quốc Gia cực kỳ thuận tiện cho giao thông đi lại;
- Nằm ở trung tâm khu vực Mỹ Đình, kết nối 2 ngã tư lớn Nguyễn Hoàng, Hàm Nghi đoạn bến xe Mỹ Đình và Lê Đức Thọ đoạn giao Hàm Nghi. Với vị trí đó, dân cư trên tuyến đường này có thể di chuyển tới các tuyến đường huyết mạch của thành phố: Phạm Hùng Phạm Văn Đồng, Hồ Tùng Mậu Xuân Thủy Cầu Giấy, tuyến Metro Nhổn Ga Hà Nội;
- Quanh khu vực là các trung tâm hành chính, văn hóa, kinh tế, xã hội của TP. Hà Nội và tiện ích hàng đầu như TTTM The Garden, đại siêu thị Metro, bệnh viện 198, Trung tâm Hội nghị Quốc gia, SVĐ Mỹ Đình, Đại học Quốc gia, Đại học FPT,...;
- Nguyễn Hoàng là một tuyến phố rộng, hai bên đều có vỉa hè, làn đường đôi, lòng đường mỗi bên rộng 10m;
- Mặt tiền rộng, thửa đất nằm trên mặt đường Nguyễn Hoàng, mặt sau là ngõ. Rất thuận tiện cho việc kinh doanh, buôn bán.
Sổ đỏ chính chủ giao dịch nhanh( chủ là đại gia kín tiếng sở hữu khối tài sản kích xù, đã xin GPXD 22 tầng nổi, 3 hầm ban đầu định xây nhưng lại thay đổi kế hoạch và quyết định bán).
* Diện tích: 2000m2, mặt tiền 50m.
* Vị trí: Mặt phố đường Lê Đức Thọ, phường Mỹ Đình 2, quận Nam Từ Liêm, Hà Nội.
* Giá bán: 400 tỷ (có thương lượng).
